import React from 'react';
import logo from './logo.svg';
import star from './star.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class="container">
        <div class="row">
          <div class="col">
          <img src={star} className="img-thumbnail img-fluid rounded" alt="logo" />
          </div>
          <div class="col">
          <img src={star} className="img-thumbnail img-fluid rounded" alt="logo" />
          </div>
        </div>
        <div class="row">
          <div class="col">
          <img src={star} className="img-thumbnail img-fluid rounded" alt="logo" />
          </div>
          <div class="col">
          <img src={star} className="img-thumbnail img-fluid rounded" alt="logo" />
          </div>
          <div class="col">
          <img src={star} className="img-thumbnail img-fluid rounded" alt="logo" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
